t von 60 Tagen. Wir stehen fr die Qualitt unserer elektronischen Produkte.','customer','de','approved',3,'2024-06-29 01:55:46',NULL,NULL),(9,'Rckgabebedingungen fr Mbel','rckgabebedingungen-fr-mbel','Unsere Rckgaberichtlinie fr Mbel ermglicht es Ihnen, Mbel innerhalb von 7 Tagen zurckzugeben, wenn sie nicht Ihren Erwartungen entsprechen. Kundenzufriedenheit ist unsere Prioritt.','customer','de','approved',4,'2024-06-29 01:55:46',NULL,NULL),(10,'Richtlinien fr Sonderanfertigungen','richtlinien-fr-sonderanfertigungen','Bitte beachten Sie, dass Sonderanfertigungen von der Rckgabe oder Rckerstattung ausgeschlossen sind. Wir fertigen mageschneiderte Artikel nach Ihren Vorgaben.','customer','de','approved',5,'2024-06-29 01:55:46',NULL,NULL);
