INSERT INTO `terms_and_conditions` VALUES (1,1,NULL,'Disclaimers and Limitation of Liability','disclaimers-and-limitation-of-liability','The Website is provided \"as is\" and \"as available\" without any warranties, either expressed or implied. Pickbazar shall not be liable for any direct, indirect, incidental, special, consequential, or punitive damages resulting from the use or inability to use the Website.','global','Super Admin',1,'en',NULL,'2024-06-29 01:55:46',NULL),(2,1,NULL,'Intellectual Property','intellectual-property','The Website and its original content, features, and functionality are owned by [Your Company] and are protected by international copyright, trademark, and other intellectual property laws.','global','Super Admin',1,'en',NULL,'2024-06-29 01:55:46',NULL),(3,1,NULL,'Privacy Policy','privacy-policy','Your use of the Website is also governed by our Privacy Policy, which can be found [link to Privacy Policy]. By using the Website, you consent to the practices described in the Privacy Policy.','global','Super Admin',1,'en',NULL,'2024-06-29 01:55:46',NULL),(4,1,NULL,'Use of the Website','use-of-the-website','You must be at least [Age] years old to use this Website. By using the Website, you represent and warrant that you are at least [Age] years old. You agree to use the Website for lawful purposes only and in a manner that does not infringe upon the rights of others.','global','Super Admin',1,'en',NULL,'2024-06-29 01:55:46',NULL),(5,1,NULL,'Acceptance of Terms','acceptance-of-terms','By using this Website, you agree to comply with and be bound by these terms and conditions. If you do not agree to these terms, please do not use the Website.','global','Super Admin',1,'en',NULL,'2024-06-29 01:55:46',NULL),(6,1,NULL,'Haftungsausschluss und Haftungsbeschrnkung','haftungsausschluss-und-haftungsbeschrnkung','Die Website wird wie besehen und wie verfgbar ohne jegliche ausdrckliche oder stillschweigende Gewhrleistung bereitgestellt. Pickbazar haftet nicht fr direkte, indirekte, zufllige, besondere, Folge- oder Strafschden, die sich aus der Nutzung oder Unmglichkeit der Nutzung der Website ergeben.','global','Super Admin',1,'de',NULL,'2024-06-29 01:55:46',NULL),(7,1,NULL,'Geistiges Eigentum','geistiges-eigentum','Die Website und ihre ursprnglichen Inhalte, Merkmale und Funktionen sind Eigentum von [Ihrem Unternehmen] und durch internationale Urheber-, Marken- und andere Gesetze zum Schutz des geistigen Eigentums geschtzt.','global','Super Admin',1,'de',NULL,'2024-06-29 01:55:46',NULL),(8,1,NULL,'Datenschutzrichtlinie','datenschutzrichtlinie','Ihre Nutzung der Website unterliegt auerdem unserer Datenschutzrichtlinie, die Sie unter [Link zur Datenschutzrichtlinie] finden. Durch die Nutzung der Website stimmen Sie den in der Datenschutzrichtlinie beschriebenen Praktiken zu.','global','Super Admin',1,'de',NULL,'2024-06-29 01:55:46',NULL),(9,1,NULL,'Nutzung der Website','nutzung-der-website','Sie mssen mindestens [Alter] Jahre alt sein, um diese Website nutzen zu knnen. Durch die Nutzung der Website erklren und garantieren Sie, dass Sie mindestens [Alter] Jahre alt sind. Sie erklren sich damit einverstanden, die Website nur fr rechtmige Zwecke und in einer Weise zu nutzen, die nicht die Rechte anderer verletzt.','global','Super Admin',1,'de',NULL,'2024-06-29 01:55:46',NULL),(10,1,NULL,'Annahme der Bedingungen','annahme-der-bedingungen','Durch die Nutzung dieser Website erklren Sie sich damit einverstanden, diese Allgemeinen Geschftsbedingungen einzuhalten und an sie gebunden zu sein. Wenn Sie diesen Bedingungen nicht zustimmen, nutzen Sie die Website bitte nicht.','global','Super Admin',1,'de',NULL,'2024-06-29 01:55:46',NULL);
